import React, { useEffect, useState } from 'react';
import '../styles/Bookings.css';
import axios from 'axios';

const Bookings = () => {
  const [bookings, setBookings] = useState([]);
  const userId = localStorage.getItem('userId');

  useEffect(() => {
    fetchBookings();
  }, []);

  const fetchBookings = async () => {
    try {
      const response = await axios.get('http://localhost:6001/fetch-bookings');
      const fetchedBookings = response.data;
      setBookings(fetchedBookings.length ? fetchedBookings.reverse() : getDefaultBookings());
    } catch (error) {
      console.error('Error fetching bookings:', error);
      setBookings(getDefaultBookings());
    }
  };

  const cancelTicket = async (id) => {
    try {
      await axios.put(`http://localhost:6001/cancel-ticket/${id}`);
      alert('Ticket cancelled!');
      fetchBookings();
    } catch (error) {
      console.error('Error cancelling ticket:', error);
    }
  };

  const getDefaultBookings = () => [
    {
      _id: 'default1',
      user: userId,
      mobile: '1234567890',
      email: 'user@example.com',
      flightId: 'FL001',
      flightName: 'Default Airlines',
      departure: 'City A',
      destination: 'City B',
      passengers: [
        { name: 'John Doe', age: 30 },
        { name: 'Jane Doe', age: 28 },
      ],
      seats: '12A, 12B',
      bookingDate: new Date().toISOString(),
      journeyDate: new Date(new Date().setDate(new Date().getDate() + 7)).toISOString(),
      journeyTime: '10:00 AM',
      totalPrice: 200,
      bookingStatus: 'confirmed',
    },
  ];

  return (
    <div className="user-bookingsPage">
      <h1>Bookings</h1>

      <div className="user-bookings">
        {bookings
          .filter((booking) => booking.user === userId)
          .map((booking) => (
            <div className="user-booking" key={booking._id}>
              <p>
                <b>Booking ID:</b> {booking._id}
              </p>
              <span>
                <p>
                  <b>Mobile:</b> {booking.mobile}
                </p>
                <p>
                  <b>Email:</b> {booking.email}
                </p>
              </span>
              <span>
                <p>
                  <b>Flight Id:</b> {booking.flightId}
                </p>
                <p>
                  <b>Flight name:</b> {booking.flightName}
                </p>
              </span>
              <span>
                <p>
                  <b>On-boarding:</b> {booking.departure}
                </p>
                <p>
                  <b>Destination:</b> {booking.destination}
                </p>
              </span>
              <span>
                <div>
                  <p>
                    <b>Passengers:</b>
                  </p>
                  <ol>
                    {booking.passengers.map((passenger, i) => (
                      <li key={i}>
                        <p>
                          <b>Name:</b> {passenger.name}, <b>Age:</b> {passenger.age}
                        </p>
                      </li>
                    ))}
                  </ol>
                </div>
                {booking.bookingStatus === 'confirmed' && <p><b>Seats:</b> {booking.seats}</p>}
              </span>
              <span>
                <p>
                  <b>Booking date:</b> {booking.bookingDate.slice(0, 10)}
                </p>
                <p>
                  <b>Journey date:</b> {booking.journeyDate.slice(0, 10)}
                </p>
              </span>
              <span>
                <p>
                  <b>Journey Time:</b> {booking.journeyTime}
                </p>
                <p>
                  <b>Total price:</b> {booking.totalPrice}
                </p>
              </span>
              <p
                style={{ color: booking.bookingStatus === 'cancelled' ? 'red' : 'black' }}
              >
                <b>Booking status:</b> {booking.bookingStatus}
              </p>
              {booking.bookingStatus === 'confirmed' && (
                <div>
                  <button
                    className="btn btn-danger"
                    onClick={() => cancelTicket(booking._id)}
                  >
                    Cancel Ticket
                  </button>
                </div>
              )}
            </div>
          ))}
      </div>
    </div>
  );
};

export default Bookings;
